INSERT INTO [dbo].[dbQK] ([cCode], [cJoinName], [cPhoneNumber], [zDeptCode], [cNR], [cBZ], [bView], [dDate], [cBT], [cSign], [cURL], [bKNM]) VALUES (N'QK20180610-0006', N'13994231544', N'', null, N'1. 最近我看见这么一段话，说你判断一个人是不是某个方面的高手，你就问他问题。.你问一个点，他回答一个面，你再顺着这个面追问，他如果能回答一张网，那基本就可以判定，他是这行的高手了。.2. 比如说，你问一个学者，他这门学科里有哪些他佩服的大师。如果他只说得出一个，那就只是一个粉丝而已。如果他能说出好几个人，而且是不同维度的标准，那就说明在他的认知地图上，这个学科被展开了。.3. 你再追问，这几个人为什么是大师，他能说出这些大师出现的社会条件、学术背景、和其他学科的联系。那就说明他对这门学科的认识，已经嵌入到整个人类文明的网络里了。', N'所有人', null, N'2018-06-10 08:50:23.000', N'怎么识别一个高手？（选自罗辑思维）', null, N'https://aiwei-image.oss-cn-beijing.aliyuncs.com/TZ/QK20180610-0006.jpg', N'0')
