INSERT INTO [dbo].[DSJB] ([cCode], [RQ], [NR], [JLR]) VALUES (N'DJ20180124-0001', N'2018-01-24', N'2018年1月24日民盟山西省委农村工作委员会、山西省科技扶贫中心，组织了“娃哈哈腊八公益施粥”捐赠活动，给孩子们和教职工带来了节日的慰问。并参观了相关科室。', N'KB20171231-0003')
