GO
INSERT INTO [dbo].[DSJB] ([cCode], [RQ], [NR], [JLR]) VALUES (N'DJ20180202-0001', N'2018-01-31', N'1月31日上午，中心召开中层干部及党员学习会议，传达学习党的十九届二中全会精神、十九届中央纪委二次全会精神以及1月21日山西省委常委会议精神。中心支部书记张欣荣主持学习，全体中层干部及党员参加。', N'KB20171231-0003')
GO
GO
INSERT INTO [dbo].[DSJB] ([cCode], [RQ], [NR], [JLR]) VALUES (N'DJ20180202-0002', N'2018-01-31', N'1月31日上午，由中心支部书记张欣荣主持，召开全体中层干部及党员学习会议。集中学习了《习近平谈治国理论》（第二卷）第二章以及习近平新时代中国特色社会主义思想：“八个明确”“十四个坚持”等内容。', N'KB20171231-0003')
