INSERT INTO [dbo].[DSJB] ([cCode], [RQ], [NR], [JLR]) VALUES (N'DJ20180202-0003', N'2018-01-31', N'1月31日上午，由中心支部书记、主任张欣荣主持，召开了党的十九大精神专题研讨会，全体中层干部及党员参加学习会议。', N'KB20171231-0003')
