-- ----------------------------
-- Table structure for syscolumns
-- ----------------------------
DROP TABLE [dbo].[syscolumns]
GO
CREATE TABLE [dbo].[syscolumns] (
[name] sysname NOT NULL ,
[id] int NOT NULL ,
[xtype] tinyint NOT NULL ,
[typestat] tinyint NOT NULL ,
[xusertype] smallint NOT NULL ,
[length] smallint NOT NULL ,
[xprec] tinyint NOT NULL ,
[xscale] tinyint NOT NULL ,
[colid] smallint NOT NULL ,
[xoffset] smallint NOT NULL ,
[bitpos] tinyint NOT NULL ,
[reserved] tinyint NOT NULL ,
[colstat] smallint NOT NULL ,
[cdefault] int NOT NULL ,
[domain] int NOT NULL ,
[number] smallint NOT NULL ,
[colorder] smallint NOT NULL ,
[autoval] varbinary(8000) NULL ,
[offset] smallint NOT NULL ,
[collationid] int NULL ,
[language] int NOT NULL ,
[status] AS (CONVERT([tinyint],((((([bitpos]&(7))+case when ([typestat]&(1))=(0) then (8) else (0) end)+case when ([typestat]&(2))<>(0) OR (type_name([xtype])='image' OR type_name([xtype])='text') AND ([colstat]&0x1000)<>(0) then (16) else (0) end)+case when (type_name([xtype])='image' OR type_name([xtype])='text') AND ([colstat]&0x2000)<>(0) OR (type_name([xtype])='timestamp' OR (type_name([xtype])='char' OR type_name([xtype])='binary')) AND ([typestat]&(1))=(0) then (32) else (0) end)+case when ([colstat]&(4))<>(0) then (64) else (0) end)+case when ([colstat]&(1))<>(0) then (128) else (0) end,0)) ,
[type] AS (CONVERT([tinyint],xtypetotds([xtype],(1)-([typestat]&(1))),0)) ,
[usertype] AS (CONVERT([smallint],columnproperty([id],[name],'oldusertype'),0)) ,
[printfmt] AS (CONVERT([varchar](255),[autoval],0)) ,
[prec] AS (CONVERT([smallint],case when type_name([xtype])='ntext' OR (type_name([xtype])='image' OR type_name([xtype])='text') then NULL when type_name([xtype])='uniqueidentifier' then [xprec] else odbcprec([xtype],[length],[xprec]) end,0)) ,
[scale] AS (odbcscale([xtype],[xscale])) ,
[iscomputed] AS (CONVERT([int],sign([colstat]&(4)),0)) ,
[isoutparam] AS (CONVERT([int],sign([colstat]&(4)),0)) ,
[isnullable] AS (CONVERT([int],(1)-([typestat]&(1)),0)) ,
[collation] AS (CONVERT([sysname],collationpropertyfromid([collationid],'name'),0)) ,
[tdscollation] AS (CONVERT([binary](5),collationpropertyfromid([collationid],'tdscollation'),0)) 
)


GO

