-- ----------------------------
-- View structure for dbFriendView
-- ----------------------------
DROP VIEW [dbo].[dbFriendView]
GO
CREATE VIEW [dbo].[dbFriendView] AS 
SELECT     dbo.dbFriend.cCode, dbo.dbFriend.cPhoneNumber, dbo.dbFriend.cFPhoneNumber, dbo.dbUserView.cClassName, dbo.dbUserView.iphoneNumber, 
                      dbo.dbUserView.zDeptName, dbo.dbUserView.zDeptCode, dbo.dbUserView.cDeptJob, dbo.dbUserView.cEmail, dbo.dbUserView.cUnitName, dbo.dbUserView.cJob, 
                      dbo.dbUserView.cSex, dbo.dbUserView.wxName, dbo.dbUserView.wxheadimgurl, dbo.dbFriend.cBZ
FROM         dbo.dbFriend LEFT OUTER JOIN
                      dbo.dbUserView ON dbo.dbFriend.cFPhoneNumber = dbo.dbUserView.cName
GO

-- ----------------------------
-- View structure for dbGroupListView
-- ----------------------------
DROP VIEW [dbo].[dbGroupListView]
GO
CREATE VIEW [dbo].[dbGroupListView] AS 
SELECT     dbo.dbGroupList.cCode, dbo.dbGroupView.cPhoneNumber, dbo.dbGroupView.cGroupName, dbo.dbGroupView.cClassName, dbo.dbGroupList.cListCode, 
                      dbo.dbGroupList.bView, dbo.dbGroupList.bNO, dbo.dbGroupList.cPhoneNumber AS cPhoneNumberList, dbo.dbUserView.cClassName AS cClassNameList, 
                      dbo.dbUserView.wxName, dbo.dbUserView.wxnickname, dbo.dbUserView.wxheadimgurl, dbo.dbUserView.wxunionid
FROM         dbo.dbGroupList LEFT OUTER JOIN
                      dbo.dbUserView ON dbo.dbGroupList.cPhoneNumber = dbo.dbUserView.iphoneNumber LEFT OUTER JOIN
                      dbo.dbGroupView ON dbo.dbGroupList.cCode = dbo.dbGroupView.cCode
GO

-- ----------------------------
-- View structure for dbGroupView
-- ----------------------------
DROP VIEW [dbo].[dbGroupView]
GO
CREATE VIEW [dbo].[dbGroupView] AS 
SELECT     dbo.dbGroup.cCode, dbo.dbGroup.cPhoneNumber, dbo.dbGroup.cGroupName, dbo.dbGroup.bView, dbo.dbGroup.cBZ, dbo.DicDept.zDeptName, 
                      dbo.dbUserView.cClassName, dbo.dbUserView.cJob, dbo.dbUserView.cSex, dbo.dbUserView.wxName, dbo.dbUserView.cAdmin, dbo.dbUserView.wxnickname, 
                      dbo.dbUserView.wxheadimgurl, dbo.dbUserView.wxunionid, dbo.dbUserView.cUnitName, dbo.dbGroup.zDeptCode
FROM         dbo.dbGroup LEFT OUTER JOIN
                      dbo.DicDept ON dbo.dbGroup.zDeptCode = dbo.DicDept.zDeptCode LEFT OUTER JOIN
                      dbo.dbUserView ON dbo.dbGroup.cPhoneNumber = dbo.dbUserView.iphoneNumber
GO

-- ----------------------------
-- View structure for dbQKListView
-- ----------------------------
DROP VIEW [dbo].[dbQKListView]
GO
CREATE VIEW [dbo].[dbQKListView] AS 
SELECT     dbo.dbQKList.cListCode, dbo.dbQKList.cPhoneNumber, ISNULL(dbo.dbQKList.cPL, N'') AS cPL, dbo.dbQKList.dListDate, dbo.dbQKList.cListBZ, dbo.dbQKList.bDel, 
                      dbo.dbQKView.cCode, dbo.dbQKView.cJoinName, dbo.dbQKView.cNR, dbo.dbQKView.cBZ, dbo.dbQKView.wxName, dbo.dbQKView.wxnickname, 
                      dbo.dbQKView.wxunionid, dbo.dbQKView.wxheadimgurl, dbo.dbUserView.cClassName, dbo.dbUserView.wxheadimgurl AS Expr1, dbo.dbUserView.zDeptName, 
                      dbo.dbUserView.zDeptCode, dbo.dbQKView.dDate, dbo.dbQKView.cBT, dbo.dbQKList.bView, ISNULL(dbo.dbQKView.cURL, N'') AS cURL, ISNULL(dbo.dbQKList.bNM, 0) 
                      AS bNM
FROM         dbo.dbQKView LEFT OUTER JOIN
                      dbo.dbQKList ON dbo.dbQKView.cCode = dbo.dbQKList.cCode LEFT OUTER JOIN
                      dbo.dbUserView ON dbo.dbQKList.cPhoneNumber = dbo.dbUserView.iphoneNumber
GO

-- ----------------------------
-- View structure for dbQKView
-- ----------------------------
DROP VIEW [dbo].[dbQKView]
GO
CREATE VIEW [dbo].[dbQKView] AS 
SELECT     dbo.dbQK.cCode, dbo.dbQK.cJoinName, dbo.dbQK.cPhoneNumber, dbo.dbQK.cNR, dbo.dbQK.cBZ, ISNULL(dbo.dbQK.bView, 0) AS bView, dbo.dbQK.dDate, 
